async function GetItemsInfo() {
  const res = await fetch("https://panda-market-api.vercel.app/products");
  const result = await res.text();
  const data = await JSON.parse(result);
  console.log(typeof data);
  return data.list;
}

function MakeItem({ item }) {
  return (
    <div>
      <img className="item-img" src={item.images} alt={item.name} />
      <div>
        <p>{item.name}</p>
        <p>{item.price}</p>
        <p>{item.favoriteCount}</p>
      </div>
    </div>
  );
}
const data = GetItemsInfo();

function ListUpItem({ arr }) {
  return (
    <ul>
      {arr.map((item) => {
        return (
          <li>
            <MakeItem item={item} />
          </li>
        );
      })}
    </ul>
  );
}
